import {Outlet,Link} from "react-router-dom";
import {Navbar,Container,Nav} from "react-bootstrap";

export default function (){
    return(
        <>
            <Navbar bg="dark" variant="dark">
                <Container>
                    <Navbar.Brand href="/">Register</Navbar.Brand>
                    <Nav className="me-auto">
                        <Nav.Link href="/members/new">New Registration</Nav.Link>
                        <Nav.Link href="/members">View Members</Nav.Link>
                    </Nav>

                </Container>

            </Navbar>

            <Navbar bg="dark" variant="dark">
                <Container>
                    <Navbar.Brand href="/">Product</Navbar.Brand>
                    <Nav className="me-auto">
                        <Nav.Link href="/members/new">Create Product</Nav.Link>
                        <Nav.Link href="/members">Product List</Nav.Link>
                    </Nav>

                </Container>

            </Navbar>
            <Navbar bg="dark" variant="dark">
                <Container>
                    <Navbar.Brand href="/">Order</Navbar.Brand>
                    <Nav className="me-auto">
                        <Nav.Link href="/members/new">Order Product</Nav.Link>
                        <Nav.Link href="/members">Order List</Nav.Link>
                    </Nav>

                </Container>

            </Navbar>


            <nav>

                <Link to="/">Home</Link>
                ||
                <Link to="/members/new">register</Link>
                ||
                <Link to="/members">registered List</Link>
                ||
                <Link to="/items/new">register product</Link>
                ||
                <Link to="/items">product List</Link>
                ||
                <Link to="/order">product order</Link>
                ||
                <Link to="/orders">order List</Link>

                <Outlet />

            </nav>


        </>
    )
}

